import './App.css';
import Array from './Components/Array';
import {Container, Row, Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <Container>
      <Row>
        <Col sm = "12" md = "6" lg = "4">
          <Array />   
        </Col>  
      </Row>
    </Container>
  );
}

export default App;
